// *** generic setters ***
// use _SET suffixes

// metadata
export const compName_SET = 'compName_set';
export const matchType_SET = 'matchType_set';
export const matchNumber_SET = 'matchNumber_set';
export const teamNumber_SET = 'teamNumber_set';
export const scouterName_SET = 'scouterName_set';
export const whenCaptured_SET = 'whenCaptured_set';
export const scouterTeamNumber_SET = 'scouterTeamNumber_set';
export const driverStation_SET = 'driverStation_set';
// autonomous
export const startPlace_SET = 'startPlace_set';
export const ballsInUpperAuto_SET = 'ballsInUpperAuto_set';
export const ballsInLowerAuto_SET = 'ballsInLowerAuto_set';
export const ballsMissedAuto_SET = 'ballsMissedAuto_set';
export const passedLine_SET = 'passedLine_set';
export const ballsHumanShotAuto_SET = 'ballsHumanShotAuto_set';
export const ballsHumanScoredAuto_SET = 'ballsHumanScoredAuto_set';
export const whichBallsCollected_SET = 'whichBallsCollected_set';
export const autoMalfunction_SET = 'autoMalfunction_set';
export const autoFreeText_SET = 'autoFreeText_set';
// teleop
export const ballsInUpperTele_SET = 'ballsInUpperTele_set';
export const ballsInLowerTele_SET = 'ballsInLowerTele_set';
export const ballsMissedTele_SET = 'ballsMissedTele_set';
// endgame
export const levelClimbed_SET = 'levelClimbed_set';
export const climbSuccessful_SET = 'climbSuccessful_set';
export const climbTime_SET = 'climbTime_set';
// post game
export const defensiveDefenseLevel_SET = 'defensiveDefenseLevel_set';
export const offensiveDefenseLevel_SET = 'offensiveDefenseLevel_set';
export const wasDefendedLevel_SET = 'wasDefendedLevel_set';
export const shootingLocations_SET = 'shootingLocations_set';
export const collectingLocations_SET = 'collectingLocations_set';
export const goodTeamMateLevel_SET = 'goodTeamMateLevel_set';
export const wasBroken_SET = 'wasBroken_set';
export const freeText_SET = 'freeText_set';
export const generalImpression_SET = 'generalImpression_set';
export const robotNoFunction_SET = 'robotNoFunction_set';
export const systemNoFunction_SET = 'systemNoFunction_set';


// ** increment and decrement **
// explanation of meaning: inc = increased  (default is 1), dec = decreased (default is 1)
// use _INC and _DEC suffixes

// autonomous
export const ballsInUpperAuto_INC = 'ballsInUpperAuto_set';
export const ballsInUpperAuto_DEC = 'ballsInUpperAuto_set';

export const ballsInLowerAuto_INC = 'ballsInLowerAuto_set';
export const ballsInLowerAuto_DEC = 'ballsInLowerAuto_set';

export const ballsMissedAuto_INC = 'ballsMissedAuto_set';
export const ballsMissedAuto_DEC = 'ballsMissedAuto_set';


// teleop
export const ballsInUpperTele_INC = 'ballsInUpperTele_set';
export const ballsInUpperTele_DEC = 'ballsInUpperTele_set';

export const ballsInLowerTele_INC = 'ballsInLowerTele_set';
export const ballsInLowerTele_DEC = 'ballsInLowerTele_set';

export const ballsMissedTele_INC = 'ballsMissedTele_set';
export const ballsMissedTele_DEC = 'ballsMissedTele_set';
